import React from 'react'
import transformDataToSunburst from '../../../TransformDate/transformDataToSunburst'

const StaticStackedBar = ({ data }) => {
  const transformedData = React.useMemo(
    () => transformDataToSunburst(data),
    [data]
  )

  return <StaticStackedBar data={transformedData} />
}

export default StaticStackedBar
